window.bookSummaryJSON = "<p>The Twilight Ocean holds unfathomable treasures, but you need strength to seize them.</p> <p>Just after arriving in Twilight Harbor, Zac finds himself enlisted by the Draugr Catheya to participate in a once-in-a-millennium trial. The rewards are exactly what he needs to advance his cultivation.</p> <p>But danger goes hand in hand with opportunity. Zac will be pitted against not only the local elites, but talents of B-grade factions. Furthermore, the Twilight Ascent is not what it seems.</p> <p>Fate is gathering. Ancient forces are sharpening their swords, their eyes trained at the chance for ascension.</p> <p>Audiobook eight in the hit Defiance of the Fall Series. Download your copy today!</p>"; 
